import React from 'react';
import map from './logo.png';
import './App.css';
import { Button } from 'semantic-ui-react'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={map} className="App-logo" alt="logo"/>
        <p>
          <input type="submit" value="Login" />
          <Link to="/dashboard">
              <Button style={myStyle}>
                  <p>Click Me!</p>
              </Button>
          </Link>
        </p>
      </header>

    </div>
  );
}

export default App;
